import React from 'react'
import { Header } from 'semantic-ui-react'

const MatchesHeader = () => {
    console.log("MatchesHeader");
    return (
        <Header block as='h2' color='blue'>
            All your matches
            <Header.Subheader>
                Manage your account settings and set email preferences
            </Header.Subheader>
        </Header>
    )
}

export default MatchesHeader
